package HashSet;

import java.util.HashSet;

public class HashSetExample {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		HashSet<String> hset=new HashSet<String>();
		
		hset.add("Java");
		hset.add("J2EE");
		hset.add("Servlets");
		hset.add("JSP");
		hset.add("JDBC");
		
		System.out.println(hset);
	}
	
	

}
